import { Tree } from 'antd';
import React from 'react';


class TreeItem extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <span color="red" >
                <div>{this.props.Name}</div>
                {this.props.totaldesc}
            </span >
        )
    }
}

export default TreeItem;
